import ApexCharts from "react-apexcharts";
import $ from 'jquery';
function Chart() {

    const data = JSON.parse(window.localStorage.getItem('total'));
    const deathCntData = [].sort();
    const decideCntData = [].sort();
    const stateDtData = [].sort();
    data.forEach(element => {
        deathCntData.push(element.deathCnt);
        decideCntData.push(element.decideCnt);
        stateDtData.push(element.stateDt);
    });

    // console.log(deathCntData, decideCntData, stateDtData.sort());


    return <div>adsd</div> 
    // <ApexCharts
